Michèle Lamy presents a creative program from the hyper-personal setting of the #MONCLERRICKOWENS tour bus. The day evolves with multiple layers and is inspired by Jacques Rivette's arthouse classic 'L'Amour Fou'. Featuring conversations with Davide Oldani, Vittorio Da Mosto, Paolo Rosso (hosted by @juliastoschekcollection), Alessio Ascari and Myriam Ben Salah, and culminating in a live performance by @lalamichmich. Collection launches tomorrow. @RickOwensOnline 

